import ExpenseItem from "./components/ExpenseItem"

function App() {

  const data = [
    {
      "title": "item1",
      "date": new Date(2021, 10, 5),
      "price": 123
   },
   {
     "title": "item2",
     "date": new Date(2021, 11, 23),
     "price": 66
   },
   {
     "title": "item3",
     "date": new Date(2021, 12, 5),
     "price": 98
   }
  ]

  return (
    <div>
      <ExpenseItem
        title={data[0].title}
        date={data[0].date}
        price={data[0].price}
      ></ExpenseItem>
      <ExpenseItem
        title={data[1].title}
        date={data[1].date}
        price={data[1].price}
      ></ExpenseItem>
    </div>
  );
}

export default App;
